import React, { useState, useEffect } from "react";
import axios from "axios";

export default function CCFeatures() {
  const [CCData, setCCData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(false);

  useEffect(() => {
    fetchCCData();
  }, []);

  const fetchCCData = async () => {
    const data = await axios
      .get("https://mocki.io/v1/b9c63035-97c5-40a0-b45c-2abdf5261bd")
      .then((res) => res.data)
      .catch((err) => {
        console.log(err);
        setError(true);
      });

    setCCData(data);
    setLoading(false);
  };

  if (error) return <p>There was an error aquiring the data</p>;
  return (
    <div className="cc-features-container">
      <h1>Experince The Cardo</h1>
    </div>
  );
}
